import React from 'react'
import data from "../../data/events.json"
import "../../App.css"


const Events = () => {
    return (
        <div>
            <div className="container"></div>
            <h1>Алдыдагы окуялар</h1>
            {data.map((event) => (
                <div key={event._id}>
                    <h2>{event.title}</h2>
                    <p>{event.date}</p>
                    <p>{event.content}</p>
                </div>
            ))}
        </div>
    )
}

export default Events
